import React from 'react';
import GetLink from '../SharedComponents/DynamicRouter';

function MyComponent() {
    return (
        <div>
            <GetLink title='Page 1' Disp='page-1' Class='img p1'></GetLink>
            <GetLink title='Page 1' Disp='page-2' Class='img p2'></GetLink>
            <GetLink title='Page 1' Disp='page-3' Class='img p3'></GetLink>
            <style jsx global>
                {`
                    a {
                        color: blue;
                    }

                    .img {
                        height: 50px;
                        width: 50px;
                        background-size: cover !important;
                        background-repeat: no-repeat !important;
                        background-position: center !important;
                        border: 1px solid black;
                        border-radius: 10px;
                        display: inline-block;
                        margin-top: 10px;
                    }

                    .p1 {
                        background: url(../static/Images/home-bg.jpg);
                    }

                    .p2 {
                        background: url(../static/Images/jr-korpa-wAXD_Its-48-unsplash.jpg);
                    }

                    .p3 {
                        background: url(../static/Images/kasper-rasmussen-XTHSOaUWrX0-unsplash.jpg);
                    }
                `}
            </style>
        </div>
    );
}

export default MyComponent;
